import createReactComponent from "../createReactComponent";
import defaultAttributes from "../defaultAttributes";
var Map = createReactComponent("Map", ["svg", defaultAttributes, [["polygon", {
  points: "1 6 1 22 8 18 16 22 23 18 23 2 16 6 8 2 1 6",
  key: "yi6pq4"
}], ["line", {
  x1: "8",
  y1: "2",
  x2: "8",
  y2: "18",
  key: "ekzmkr"
}], ["line", {
  x1: "16",
  y1: "6",
  x2: "16",
  y2: "22",
  key: "1y28ex"
}]]]);
export default Map;
